    res.json(blog);
  });
};

export const updateBlog = (req, res) => {
  Blog.findOneAndUpdate(
    { firstname: req.params.firstname },
    req.body,
    {
      new: true
    },
    (err, blog) => {
      if (err) {
        res.send(err);
      }
      res.json(blog);
    }
  );
};

export const deleteBlog = (req, res) => {
  Blog.deleteOne({ firstname: req.params.firstname }, (err, blog) => {
